declare (strict_types=1);
namespace Thinker\traits\app;

use think\Request;
trait ErrorPage
{
    /**
     * 设置错误信息
     * @access public
     * @param think\Request $request
     * @param array $options 配置参数
     * @return string
     */
    public function setErrorPage(Request $request, array $options = array())
    {
        if (!isset($options['error_message'])) {
            $options['error_message'] = config('app.error_message', '页面错误！请稍后再试～');
        }
        if (!isset($options['bar'])) {
            $options['bar'] = '发生以下错误：';
        }
        if (!isset($options['tips'])) {
            $options['tips'] = array();
            $options['tips'][] = '请求的URL导致内部服务器错误。';
            $options['tips'][] = '如果您反复收到此消息，请与网站管理员联系。';
        }
        return setErrorPage($request, $options);
    }
}
